import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Button, Label } from 'reactstrap';

export default function Pregunta(props) {
    return (
        <div> 
            <label>hoa</label>
            {props.preguns.map((v, index) => (
                <div key={index}>
                    <Label>{v.texto}</Label>
                    {v.respuestas.map((j, index) => (
                        <Button key={index} color='primary'>{j.respuesta}</Button>
                    ))}
                </div>
            ))}
        </div>
    );
}
